import React from 'react'

export default function FooterBar() {
    function buttom() {
        return (
            <table>
                <tbody>
                    <tr>
                        <td className="brand"><h1>Kanta Husari</h1></td>
                        <td className="links"><h1>Links</h1></td>
                        <td className="links"><h1>Links</h1></td>
                        <td className="links"><h1>Links</h1></td>
                        <td className="links"><h1>Links</h1></td>
                        <td className="links"><h1>Links</h1></td>
                        <td className="links"><h1>Links</h1></td>
                    </tr>
                </tbody>
            </table>
        )
    }
    return (
        < div className="button" >
            {}
        </div >
    )
}



